window.bookSummaryJSON = "<p>You live in your dream house, but there's no mortgage. No alarm clock, no boss, no bills. No claims on the day's time other than what you choose. It is making more money before breakfast than you made for an entire week at your last job. It is a crazy expensive car parked in your garage, a victorious symbol that your dreams no longer sleep in fantasies, but are awake with reality.</p> <p>Make no mistake, this life exists. I know, because it has been mine for nearly 20 years. And in a few short years, it can be yours as well. Better, you won't need 5 tedious decades of thankless jobs, buzz killing frugality, and patient investing with our trusted friends on Wall Street. </p> <p>Unfortunately, you have been scripted to believe that such a life is out of your reach, or only possible for a certain type of person. Someone with a certain college degree, a certain amount of VC funding, or a certain contact list of connected friends from Stanford. I am here to tell you, that none of it is true.</p> <p>While I have been entrepreneur most of my life, I am no one special. You won't read about me over at Tech Crunch or in some Silicon Valley newsletter. While I have been an internet entrepreneur since the old \"you've got mail\" AOL days, I have never been funded by venture capitalists, I have never had a payroll with more than 5 people on it, and I have never studied computer science at school.</p> <p>Despite this, I am able to create profitable businesses that create the type of unscripted life described above. We are talking five- and six-figure monthly profits with valuations in the millions. Although I have had two successful exits, do not </p> <p><b>PLEASE NOTE: When you purchase this title, the accompanying reference material will be available in your Library section along with the audio. </b></p>"; 
